&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&iexcl;A las peque&ntilde;as fans de Disney les encantar&aacute; jugar en la simp&aacute;tica cafeter&iacute;a de Minnie Mouse! Es f&aacute;cil construir con los ladrillos LEGO&reg; DUPLO&reg; de colores, dise&ntilde;ados especialmente para peque&ntilde;os constructores. El set incluye una mesa y una silla para jugar a tomar el t&eacute;, as&iacute; como un avi&oacute;n rosa con h&eacute;lice giratoria para pasarlo genial volando. Los ladrillos especiales decorados con un pastel, cupcakes y un regalo ayudar&aacute;n a las m&aacute;s j&oacute;venes a poner en marcha sus propias historias. Incluye una figura DUPLO: Minnie Mouse.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Incluye una figura LEGO&reg; DUPLO&reg;: Minnie Mouse.&lt;/li&gt;
&lt;li&gt;Cuenta con una cafeter&iacute;a con ventana abatible, una mesa y una silla, as&iacute; como un avi&oacute;n de reparto con h&eacute;lice giratoria.&lt;/li&gt;
&lt;li&gt;&iexcl;Si&eacute;ntate a la mesa para elegir el pastel que te gustar&iacute;a probar en la cafeter&iacute;a de Minnie Mouse!&lt;/li&gt;
&lt;li&gt;Reparte pasteles en el avi&oacute;n rosa de Minnie Mouse.&lt;/li&gt;
&lt;li&gt;Accesorios incluidos: una tetera y una c&aacute;mara con visor.&lt;/li&gt;
&lt;li&gt;Incluye tambi&eacute;n ladrillos decorados con un pastel, cupcakes, un regalo y el s&iacute;mbolo de una cafeter&iacute;a para poner en marcha divertidas historias.&lt;/li&gt;
&lt;li&gt;&iexcl;Vive una nueva aventura Disney cada d&iacute;a con Minnie Mouse!&lt;/li&gt;
&lt;li&gt;Ayuda a tu hijo a desarrollar sus habilidades b&aacute;sicas de construcci&oacute;n con este sencillo modelo.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; se dise&ntilde;an espec&iacute;ficamente para ser divertidos y f&aacute;ciles de usar en las manos de los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;La fachada de la cafeter&iacute;a mide m&aacute;s de 15 cm de altura, 15 cm de ancho y 5 cm de profundidad.&lt;/li&gt;
&lt;li&gt;El avi&oacute;n mide m&aacute;s de 4 cm de altura, 14 cm de longitud y 14 cm de ancho.&lt;/li&gt;
&lt;li&gt;Edad: 2 - 5&lt;/li&gt;
&lt;li&gt;Piezas: 27&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

